webpackJsonp([0xc913ebc36ace],{9023:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Move On, There's Nothing To See",date:"13 Jun 2002",slug:"/2002-06-13-move-on-theres-nothing-to-see/",tags:"Y2002"},html:'<p>A look at my referers show I\'m being bombarded (well, nothing compared to <a href="http://www.schockwellenreiter.de/2002/06/13.html#a6025">JÃ¶rg</a>) with hits from Google looking for <a href="http://www.google.com/search?q=%22Death of a critic%22 Walser">"Death of a critic"+Walser</a>. Sorry, I don\'t really have anything more to say about it that I did <a href="/2002/05/31/index.php#001743">before</a>. And no, I don\'t know where you can download the <a href="http://www.spiegel.de/netzwelt/netzkultur/0,1518,200654,00.html">pirate version</a>. <b>Update:</b> <span style="text-decoration: line-through">Maybe here?</span> Link removed. It seems linking to pdf/html manuscripts can be <a href="http://www.schockwellenreiter.de/2002/06/14.html#a6048">expensive</a>!</p>'},next:{fields:{title:"World Cup: How German soccer fans feel",date:"12 Jun 2002",slug:"/2002-06-12-world-cup-how-german-soccer-fans-feel/"}},previous:{fields:{title:"Poor Impulse Control",date:"13 Jun 2002",slug:"/2002-06-13-poor-impulse-control/"}}},{node:{fields:{title:"World Cup: How German soccer fans feel",date:"12 Jun 2002",slug:"/2002-06-12-world-cup-how-german-soccer-fans-feel/",tags:"Y2002"},html:'<p>About France not making the 2nd round: sympathy<br />\nAbout Argentina not making the 2nd round: relief<br />\nAbout Holland not even making the 1st round: <a href="http://www.ihrseidnichtdabei.de/"><i>Schadenfreude</i></a>. Even <a href="http://www.amazon.de/exec/obidos/ASIN/B000062UZA/ref%3Ded%5Fec%5Fshop%5Fri%5F9%5F5/302-2912994-2521607">months</a> after the <a href="http://www.royal-ts.de/mtarchives/000765.php">fact</a>.</p>'},next:{fields:{title:"What Have You Done For Me Lately?",date:"12 Jun 2002",slug:"/2002-06-12-what-have-you-done-for-me-lately/"}},previous:{fields:{title:"Move On, There's Nothing To See",date:"13 Jun 2002",slug:"/2002-06-13-move-on-theres-nothing-to-see/"}}},{node:{fields:{title:"What Have You Done For Me Lately?",date:"12 Jun 2002",slug:"/2002-06-12-what-have-you-done-for-me-lately/",tags:"Y2002"},html:'<p>I just rearranged my <a href="http://www.papascott.de/referers.php">referers page</a> to sort chronologically, which seems to make more sense for a site with little traffic like this one.  I\'m still using <a href="http://ranchero.com/php/rollingreferers/">Brent\'s code</a>, but added a MAX(d) column to the SQL query, and sort on it: </p>\n<p><code>SELECT DISTINCT url, COUNT(*) as ct, MAX(d) as maxd from referers GROUP BY url ORDER BY maxd DESC, url;</code></p>\n<p>I could do some more intelligent things with the URLs (like sort out duplicates and highlight the really <a href="http://searchrequests.weblogs.com/">disturbing</a> Google queries), but maybe another day.</p>'},next:{fields:{title:"He's Back!",date:"12 Jun 2002",slug:"/2002-06-12-hes-back/"}},previous:{fields:{title:"World Cup: How German soccer fans feel",date:"12 Jun 2002",slug:"/2002-06-12-world-cup-how-german-soccer-fans-feel/"}}}],pathPrefix:"",first:!1,last:!1,index:885,pageCount:1101}}}});
